import React from 'react'


function Item(props) {
    
    return(<div className='card'>
        <div></div>
        <img  className='card-group'src='https://picsum.photos/30' alt=''/>
        <h2> {props.FullName}</h2>
        <p> {props.Professional}</p>
        <p> {props.Numberphone}</p>
        <p> {props.Email}</p>
        <p> {props.Website}</p>
        </div>
        );

}

export default Item ;
